module.exports = function(RED) {
    var settings = RED.settings;
    
    function XtermInNode(config) {
        RED.nodes.createNode(this, config);
        
        var node = this;

        node.on("close", function() {
            if (done) {
                done();
            }
        });
    }

    RED.nodes.registerType("xterm_in", XtermInNode);
}

